import React, { Component } from "react";
import Product from "./Product";

class ProductsTable extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <React.Fragment>
        {this.props.productsData.map(
          (index, product) => `<Product  product={${product[index]}}/>`
        )}
      </React.Fragment>
    );
  }
}

export default ProductsTable;
